import React from 'react';
import logo from './Legacy1.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar expand="lg" bg="light" variant="light">
        <Navbar.Brand href="#home">
          <img
            alt=""
            src={logo}
            width="100%"
            height="30"
            className="d-inline-block align-top"
          />{' '}
          LEGACY
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
          <Form inline>
            <Nav>
              <Nav.Link href="#students" className="nav-list">Students</Nav.Link>
              <Nav.Link href="#investors" className="nav-list">Investors</Nav.Link>
              <Nav.Link href="#about" className="nav-list">About</Nav.Link>
            </Nav>
          </Form>
          <Form inline>
            <FormControl type="text" placeholder="Email" className="mr-sm-2 " />
          </Form>
          <Form inline>
            <Button variant="outline-danger">Waitlist Now!</Button>
          </Form>
        </Navbar.Collapse>

      </Navbar>
      <body>
        <h1>
          Hi this is legacy
        </h1>

      </body>

    </div>
  );
}

export default App;
